import React from 'react';
import '../../styles/App.css';
import Footer from '../Footer';

function Home() {
  return (
    <>
    <div className='Home'>
    <table>
        <tr>
          <th>Book in Progress</th>
        </tr>
        <table>
          <tr>
            <td><img style={{width:80, height:80}} src={require('../Images/tmp/HP_T1').default}/></td>
            <td><img style={{width:80, height:80}} src={require('../Images/tmp/HP_T1').default}/></td>
            <td><img style={{width:80, height:80}} src={require('../Images/tmp/HP_T1').default}/></td>
          </tr>
          </table>
        </table>


    </div>
  <Footer />
  </>
  );
}

export default Home;
